import React from "react";
import classes from './style.module.css'

const Notation = () => {
    return (
        <div className={classes.container}>
            <h1 className={classes.notation1}>Don't waste time looking at offer, we will notify you!</h1>
            <h3 className={classes.notation2}>Get any product notification in just 1 step</h3>
        </div>
    )
}


export default Notation
